import React from 'react';
import ReactDOM from 'react-dom/client';
import { Document, Page } from 'react-pdf';

const PDFViewer = () => {
    const pdfURL = 'https://drive.google.com/file/d/1Nutom8q7-nj69jtFS3TKgI5oquzgpBXC/view?usp=drive_link';
   return (
     <div>
     <Document file={pdfURL}>
     <Page pageNumber={1} />
     </Document>
     </div>
    );
   };

   export default PDFViewer;
